import React from 'react'
import Button from 'react-bootstrap/Button';

function Home() {
  return (
    <div className=''>
        <div className='container w-50 mt-5 text-center'>
            <h1 className='mt-5'>QUIZ</h1>
            <Button className='mt-3' variant="info">Info</Button>
        </div>
    </div>
  )
}

export default Home
